 "First, let's add up the total duration of each activity phase. Warm-up: 16 hours, 59 minutes, 48 seconds; Cardio: 7 hours, 6 minutes, 11 seconds; Strength Training: 19 hours, 20 minutes, 14 seconds; Cool Down: 4 hours, 35 minutes, 59 seconds.

